  [],\n\t\"revision_timestamp\": \"2016-07-27T22:38:32.394149\",\n\t\"name\": \"predicting-sea-level-rise-vulnerability-of-terrestrial-habitat-and-wildlife-of-the-northwe\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Chapter 1 describes the vegetation and
  topography of 20 islands of Papahanaumokuakea Marine National Monument, the distribution
  and status of wildlife populations, and the predicted impacts for a range of sea
  level rise (SLR) scenarios. This chapter also explores the potential effects of
  SLR on wildlife breeding habitats for each island. Chapter 2 details a study of
  the Laysan Island ecosystem, describing a quantitative model that incorporates SLR,
  storm wave, and rising groundwater inundation. Wildlife, storm, and oceanographic
  data allowed for an assessment of the phonological and spatial vulnerability of
  Laysan Islandu2019s breeding bird species to SLR and storms.\",\n\t\"license_title\":
